import React, { useState, useEffect } from 'react'


import mov1 from '../../assets/images/movie1.png';
import mov2 from '../../assets/images/movie2.png';
import mov3 from '../../assets/images/movie3.png';
import mov4 from '../../assets/images/movie4.png';
import mov5 from '../../assets/images/movie5.png';
import mov6 from '../../assets/images/movie6.png';
import mov7 from '../../assets/images/movie1.png';
import mov8 from '../../assets/images/movie2.png';
import mov9 from '../../assets/images/movie3.png';
import mov10 from '../../assets/images/movie4.png';
import mov11 from '../../assets/images/movie5.png';
import mov12 from '../../assets/images/movie6.png';


export default function Cinema() {
    return (
        <>
            <div id="movie-contener">
                <div className="row">
                    <div className="col-2">
                        <img src="img/movies/movie1.png" />
                        <div className="spanLink">Knives Out</div>
                        <div className="movie-desc">Knives</div>
                    </div>
                    <div className="col-2">
                        <img src="img/movies/movie2.png" />
                        <div className="spanLink">Knives</div>
                        <div className="movie-desc">Knives</div>
                    </div>
                    <div className="col-2">
                        <img src="img/movies/movie3.png" />
                        <div className="spanLink">Knives</div>
                        <div className="movie-desc">Knives</div>
                    </div>
                    <div className="col-2">
                        <img src="img/movies/movie4.png" />
                        <div className="spanLink">Knives</div>
                        <div className="movie-desc">Knives</div>
                    </div>
                    <div className="col-2">
                        <img src="img/movies/movie5.png" />
                        <div className="spanLink">Knives</div>
                        <div className="movie-desc">Knives</div>
                    </div>
                    <div className="col-2">
                        <img src="img/movies/movie6.png" />
                        <div className="spanLink">Knives</div>
                        <div className="movie-desc">Knives</div>
                    </div>
                </div>
            </div>
    </>
    );
}
